import React from "react";
import Calculator from "./components/Calculator";

function App() {
  return <div className="container text-center">
  <span style>
  < Calculator  num1={1} num2={2} operator="+"></Calculator>
  <Calculator  num1={5} num2={3} operator="/"></Calculator>
  <Calculator  num1={6} num2={2} operator="+"></Calculator>
  <Calculator  num1={8} num2={9} operator="*"></Calculator>
  </span>
</div>
}

export default App;
